<p dir="ltr"><b id="docs-internal-guid-59c31b83-7fff-bdb1-1a37-e23e9dfa1870">Libraries- Graphics, media, database, sensors, and so on.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-59c31b83-7fff-bdb1-1a37-e23e9dfa1870">Runtime-Time to execute and manage the applications</b></p>

<p dir="ltr"><b id="docs-internal-guid-59c31b83-7fff-bdb1-1a37-e23e9dfa1870">Kernel-Power, file system, driver, and process management pool.&nbsp;</b></p>

<p>&nbsp;</p>

