  array('id' => '12','user_id' => '5','course_id' => '2','section_id' => '4','title' => 'Introduction to Machine Learning','slug' => 'introduction-to-machine-learning','text' => '<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Data is mainly unstructured (more than 80%) and the size of them is increasing. They are documents, graphs, images, videos. Finding the data pattern, time spent to do this process is getting complex and more via humans.</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">At this stage machine learning comes into action. This mainly helps the data handlers to learn the data or train the data in the minimum time. There are three major types of machine learning.</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Supervised</b></p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Unsupervised and&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Reinforcement</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Supervised- The first type in machine learning follows the task-driven approach where the labeled data is used to train the algorithms. Initially, learning algorithms accept the marked data as the inputs.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Features denoted by X and the outputs Y supervised algorithm starts learning by comparison of actual production with correct outputs to find errors. Based on the error value, the whole model has been modified accordingly.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Unsupervised- A second type in the machine learning algorithms where the unlabeled data are used to train the algorithm. This means the data has no historical variables. The main purpose is to explore the data and find the structure with that.&nbsp; Since the data is unlabeled and without preprocessing, data division into train or test is not possible.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">Reinforcement Learning- The third stage in machine learning where there is no raw data is given as input. This reinforcement learning is frequently used in the streams like robotics, gaming, etc. This training consists of 3 main components such as agents, environment, and actions.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-9fa4a334-7fff-d9f7-be43-9643ff3570dc">The applications of machine learning algorithms are reflected in various areas such as medical, defense, technology, finance, security, etc.&nbsp;</b></p>','video_src' => '{"source":"html5","html5_video_id":"196","html5_video_poster_id":"195","source_external_url":null,"source_youtube":"https:\\/\\/youtu.be\\/rHeaoaiBM6Y","source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"02","secs":"15"}}','video_time' => '135','item_type' => 'lecture','is_preview' => '1','status' => '1','sort_order' => '1','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 01:38:39','updated_at' => '2021-12-29 17:14:28'),
