<p dir="ltr"><b id="docs-internal-guid-5c2422cb-7fff-2e7b-70a4-9ef9ab216c84">The questionnaire section validates the knowledge you have gained on machine learning techniques. Also, this tests how much you show interest in machine learning techniques clearly.</b></p>','video_src' => NULL,'video_time' => '0','item_type' => 'quiz','is_preview' => '0','status' => '1','sort_order' => '2','options' => '{"show_time":"1","time_limit":"10","passing_score":"50","questions_limit":"8"}','quiz_gradable' => '1','unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 01:48:51','updated_at' => '2021-12-23 18:02:12'),
  array('id' => '15','user_id' => '5','course_id' => '2','section_id' => '4','title' => 'Describe the types of machine learning in detail?','slug' => 'describe-the-types-of-machine-learning-in-detail','text' => '<p dir="ltr"><b id="docs-internal-guid-2dd70c89-7fff-7822-7ec5-ef1f75e3ea35">This assignment validates your level of understanding regarding machine-level basic concepts, what are all types of machine learning basically grouped, how they differed in each way. Prepare this assignment with the details of each technique and do a comparison at the end.&nbsp;</b></p>','video_src' => NULL,'video_time' => NULL,'item_type' => 'assignment','is_preview' => '0','status' => '1','sort_order' => '3','options' => '{"time_duration":{"time_value":"1","time_type":"weeks"},"total_number":"10","pass_number":"5","upload_attachment_limit":"1","upload_attachment_size_limit":"5"}','quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 02:05:29','updated_at' => '2021-12-23 18:05:16'),
  array('id' => '16','user_id' => '5','course_id' => '2','section_id' => '6','title' => 'Introduction to Machine Learning Techniques','slug' => 'introduction-to-machine-learning-techniques','text' => '<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Techniques used to build training data or construct the mathematical model via the special algorithms referred to as machine learning techniques. Regression, classification, clustering, and anomaly detection are the four techniques that drive automatic learning and improve the user experience.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Regression</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">The algorithms used in this technique are to make predictions in numbers. Here, the output value is real and continuous. Working with train data, regression algorithms predict the new test data. The algorithms that govern the regression are listed as follows:</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Simple Linear Regression- Simply a statistical method to predict the relationship between the 2 quantitative variables.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Lasso Regression- Least Absolute Selection Shrinkage Operator(LASSO) regression is a simple technique that minimizes the prediction error in continuous variables.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Logistic Regression- Fraud detection, clinical trials, etc wherever the output is a binary value, logistic regression applies here.</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Support Vector Regression- With the use of SVR, We can adjust the error below a threshold rather than error reduction.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Multivariate Regression- When the variables used are more, then multivariate regression algorithms get enabled.</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Multiple Regression- This works out if the variables are multiple quantitative.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Classification</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">A method that draws the conclusion from observed outcomes in the categorical order. Using classification models, we can classify the data and assign the labels to the classes. The types of classification models are binary, multi-class.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Binary- Classification among 2 distinct classes and 2 output</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Multi-class- classification of beyond 2 classes.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Clustering</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">This is one of the machine learning techniques involving the data classification into specific groups. Once we have the objects or data points, then we apply the clustering to analyze and group the data points as per properties and features in a specific manner. The methods that fall into this category are:</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Density-based- Either based on similarity or by difference, this method forms the dense regions.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Hierarchical- Tree-like structures are special things in this category.</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Partitioning-Based on the threshold value or k-value, This creates the partitions.</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Grid-based- Data splits up into a number of cells that form the grid-like structure.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Anomaly Detection</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">The process of detecting the unexpected events or the items in the dataset is simply referred to as Anomaly detection. The techniques of Anomaly detection are grouped into the following categories.</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Statistical-Mean, median, and mode were used to identify the anomaly.</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Density-based- Based on k-NN algorithms</b></p>

<p dir="ltr"><b id="docs-internal-guid-673fa155-7fff-68c6-9efe-6b21254bd69f">Cluster-based- When data points fall under the group, detecting is based on local centroids.&nbsp;</b></p>','video_src' => '{"source":"html5","html5_video_id":"198","html5_video_poster_id":"197","source_external_url":null,"source_youtube":"https:\\/\\/youtu.be\\/olFxW7kdtP8","source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"21","secs":"08"}}','video_time' => '1268','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '4','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 02:06:32','updated_at' => '2021-12-29 17:19:44'),
