	</li>
</ul>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Databases&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">AWS structure uses the four familiar databases. DynamoDB, ElastiCache, Relational Database Services(RDS), and RedShift are the commonly used databases.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">RDS gives you access to the capabilities of familiar databases like MySQL, Oracle, SQL Server, and PostgreSQL database.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">DynamoDB-Fully Managed NoSQL database which is simple and cost-effective to store and retrieve any amount of data quickly.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">ElastiCache- It is a web service that supports 2 open source engines like matched and Redis.&nbsp;</b></p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Redshift- Fast, fully-managed petabyte data warehouse service.</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Storage &amp; Content Delivery Network(CDN)</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Simple Storage Service(S3) is the storage for the internet and it is designed to make web-scale computing an easy one. Glacier is a low-cost storage service to provide secure storage space. Elastic Block Storage comprises block-level storage volumes. A storage gateway connects both cloud-based storage with on-premises to provide seamless integration.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Cross-Service</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">AWS holds the essential features that allow people to perform the following services support, marketplace, management console, and SDKs implementation.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Analytics</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Elastic MapReduce(EMR) utilizes the Hadoop, open-source framework to distribute the data and process across the resizeable clusters. Kinesis is a subdivision of analytics that is defined as a fully managed service. Kinesis allows us to build real-time dashboards.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Compute &amp; Networking</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Elastic Compute Cloud(EC2) is a simple web service that falls into the networking category and it is specially crafted to make web-scale computing as easy. Auto-scaling allows the EC2 capacity up or down automatically as per the conditions defined. It suits the applications running hourly/daily/weekly. Workspaces and the virtual private cloud allow the users to access the data and customize the whole network if there is any need.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Deployment &amp; Management</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">The frameworks that make deployment and management successful are CloudFormation, CloudWatch, Elastic Beanstalk, OpsWork, and CloudHSM. Each one plays a role in resource creation, resource and application monitoring, application container, secure access control, activity logging, managing application, and key storage respectively.&nbsp;</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">Application Services</b></p>

<p>&nbsp;</p>

<p dir="ltr"><b id="docs-internal-guid-1bacdfee-7fff-017f-891d-24a5bbc29a65">App stream, simple queue service, simple notification service, workflow, and email services are familiar application services that make running an easy one.&nbsp;</b></p>','video_src' => '{"source":"html5","html5_video_id":"153","html5_video_poster_id":"22","source_external_url":null,"source_youtube":"https:\\/\\/www.youtube.com\\/watch?v=r4YIdn2eTm4","source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"09","secs":"12"}}','video_time' => '552','item_type' => 'lecture','is_preview' => '1','status' => '1','sort_order' => '1','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 02:22:28','updated_at' => '2021-12-29 01:42:22'),
