<p>All the devices connected across AWS IoT need to be in the registry. The registry has all the details of the certificates to interact effectively with AWS IoT.&nbsp;<br />
&nbsp;<br />
To perform actions such as edit, update and delete a DynamoDB table or call Lambda function.&nbsp; Rules can be set to perform the specified action and filter messages. When particular rule tallies with the message, the rules engine trigger to perform the action based on the properties.</p>

<p>It also contains an IAM role that permits the AWS IoT access to the resources to do the particular action.&nbsp;<br />
&nbsp;<br />
AWS IoT helps devices to establish the connection with devices to the AWS cloud. The medium to communicate which IoT supports are:<br />
&nbsp;<br />
MQTT implies MQ Telemetry Transport, which is a lightweight and easy protocol that is built for low bandwidth devices having less reliable networks. It&rsquo;s designed to reduce the network bandwidth and also minimize the resource requirements which assures stability and a good extent of delivery. This assumption helps Machine to Machine (M2M) and mobile applications where there is good quality bandwidth.&nbsp;<br />
<br />
The TLS protocol provides a channel for the client-server applications to interact via a&nbsp; network which is built to prevent issues such as tampering because protocols can work irrespective of having a TSL, it&#39;s essential that the customer has to notify the server to establish a&nbsp;<a href="https://en.wikipedia.org/wiki/Transport_Layer_Security#:~:text=13%20External%20links-,Description,setup%20of%20a%20TLS%20connection." rel="noreferrer" target="_blank" title="Transport Layer Security">TLS connection</a>. It can be done in two ways. One way is to employ a distinct port number to secure a TLS connection. The second method is to use a protocol mechanism that can be used for the client to prompt the server to switch to the TLS connection.&nbsp;</p>

<p>If you want to grow in your career or looking to jump to the next level of your job, then learning an AWS training course and holding an AWS certification is an important asset to you.</p>','video_src' => '{"source":"html5","html5_video_id":"155","html5_video_poster_id":"154","source_external_url":null,"source_youtube":"https:\\/\\/www.youtube.com\\/watch?v=etrELgrffrc","source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"29","secs":"47"}}','video_time' => '1787','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '4','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-23 15:46:14','updated_at' => '2021-12-29 01:45:43'),
