  array('id' => '67','user_id' => '5','course_id' => '11','section_id' => '32','title' => 'Class and Object','slug' => 'class-and-object','text' => '<h2>Class</h2>

<p>Collection of objects&nbsp;is called class. It is a logical entity.</p>

<p>A class can also be defined as a blueprint from which you can create an individual object. Class doesn&#39;t consume any space.</p>

<p>Any entity that has state and behavior is known as an object. For example, a chair, pen, table, keyboard, bike, etc. It can be physical or logical.</p>

<p>An Object can be defined as an instance of a class. An object contains an address and takes up some space in memory. Objects can communicate without knowing the details of each other&#39;s data or code. The only necessary thing is the type of message accepted and the type of response returned by the objects.</p>

<p><strong>Example:</strong>&nbsp;A dog is an object because it has states like color, name, breed, etc. as well as behaviors like wagging the tail, barking, eating, etc.</p>','video_src' => '{"source":"html5","html5_video_id":"204","html5_video_poster_id":"205","source_external_url":null,"source_youtube":null,"source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"00","secs":"34"}}','video_time' => '0','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '2','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-28 00:05:48','updated_at' => '2021-12-29 17:29:21'),
  array('id' => '68','user_id' => '5','course_id' => '11','section_id' => '32','title' => 'Inheritance','slug' => 'inheritance','text' => '<p>When one object acquires all the properties and behaviors of a parent object, it is known as inheritance. It provides code reusability. It is used to achieve runtime polymorphism.</p>','video_src' => '{"source":"html5","html5_video_id":"207","html5_video_poster_id":"206","source_external_url":null,"source_youtube":null,"source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"00","secs":"23"}}','video_time' => '0','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '3','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-28 00:13:29','updated_at' => '2021-12-29 17:32:26'),
  array('id' => '69','user_id' => '5','course_id' => '11','section_id' => '32','title' => 'Polymorphism','slug' => 'polymorphism','text' => '<p>If&nbsp;one task is performed in different ways, it is known as polymorphism. For example: to convince the customer differently, to draw something, for example, shape, triangle, rectangle, etc.</p>

<p>In Java, we use method overloading and method overriding to achieve polymorphism.</p>

<p>Another example can be to speak something; for example, a cat speaks meow, dog barks woof, etc.</p>','video_src' => '{"source":"html5","html5_video_id":"209","html5_video_poster_id":"208","source_external_url":null,"source_youtube":null,"source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"00","secs":"34"}}','video_time' => '0','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '4','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-28 00:17:11','updated_at' => '2021-12-29 17:35:51'),
  array('id' => '70','user_id' => '5','course_id' => '11','section_id' => '32','title' => 'Abstraction','slug' => 'abstraction','text' => '<p>Hiding internal details and showing functionality&nbsp;is known as abstraction. For example phone call, we don&#39;t know the internal processing.</p>','video_src' => '{"source":"html5","html5_video_id":"210","html5_video_poster_id":"201","source_external_url":null,"source_youtube":null,"source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"00","secs":"23"}}','video_time' => '0','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '5','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-28 00:19:19','updated_at' => '2021-12-29 17:38:21'),
  array('id' => '71','user_id' => '5','course_id' => '11','section_id' => '32','title' => 'Encapsulation','slug' => 'encapsulation','text' => '<p>Binding (or wrapping) code and data together into a single unit are known as encapsulation. For example, a capsule, it is wrapped with different medicines.</p>

<p>A java class is the example of encapsulation. Java bean is the fully encapsulated class because all the data members are private here.</p>','video_src' => '{"source":"html5","html5_video_id":"212","html5_video_poster_id":"211","source_external_url":null,"source_youtube":null,"source_vimeo":null,"source_embedded":null,"runtime":{"hours":"00","mins":"00","secs":"32"}}','video_time' => '0','item_type' => 'lecture','is_preview' => NULL,'status' => '1','sort_order' => '6','options' => NULL,'quiz_gradable' => NULL,'unlock_date' => NULL,'unlock_days' => NULL,'created_at' => '2021-12-28 00:20:45','updated_at' => '2021-12-29 17:40:58'),
